  false,\n\t\"url\": null,\n\t\"notes\": \"MSDIS staff provided project management
  and worked with the Mid-MO RPC to address data sharing issues within their region.
  MSDIS staff identified and located all ?binary? structures and compiled them into
  a spatial database. That data was then given to Mid-MO RPC for review, with the
  option of validating and attributing the data. Annual review and maintenance of
  the database will occur with the assistance of local government and emergency management
  partners. An annually updated version of this database will be provided to MSDIS
  for dissemination to other state and federal agencies.Missouri Structure Footprints
  are structure footprints generated as polygons from a two pass look over the 2007
  State 2ft imagery. Unlike the structure points, the building footprint was digitized
  for all structures larger than the standard domicile structure size. This includes
  all features greater than or equal to 500 square meters, and may include features
  less than 500 square meters. The geodatabase design is based on the USGS Best Practices
  File Template 92v102.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
